import React from 'react';
import { BusinessRating } from '../../../BusinessRating/BusinessRating';
import styles from './SearchResult.module.css';

export function SearchResult(props){
    if(!props.business){
        return(<div></div>);
    }

    const tags = props.business.map(category => (<span className="tag" key={props.business.id + category.title}>{category.title}</span>))

    return(

        <div className={styles['search-result']}>
            <img src={props.business.image_url} alt='business' className={styles['business-image']}/>
            <div className={styles['business-info']}>
                <h2 className="subtitle">{props.business.name}</h2>
                <BusinessRating reviewCount={props.business.review_count} rating={props.business.rating}/>
                <p>$$ 
                    {tags}
                </p>

            </div>
            <div className={styles['contact-info']}>
                <p>+91919191919 </p>
                <p>Example Street 5</p>
                <p>12345 Buffalo</p>
            </div>

        </div>
    );
}
